(107, 76, 'INB17418795', 'Inbound', 29, 'Email', 'Jovon,\r\n\r\nCertainly we already have an estimate for the site. We also have a formal presentation of the survey today with Scott. If you would like and have time to join we would be delighted to have you on our call at noon today California Time.\r\n\r\nBy the way Sir, we would like to thank you for allowing HCL conduct the detailed Wi-FI survey for the San Jose Site.\r\n\r\nBest Regards,\r\n\r\n\r\n[BD-EMail-Logo]\r\nCesar Fiestas\r\nNetwork & Voice Services Consultant\r\nRemote Office\r\nUSA    : +1   434-321-4261\r\nPERU : +51  941-757-919\r\nEmail: cesar.fiestas@bd.com<mailto:cesar.fiestas@bd.com>\r\nWhatsApp: +51941757919\r\n\r\n[ccielogo][ecselogo]\r\n\r\nbd.com\r\n\r\n\r\nFrom: Jovon English\r\nSent: Friday, February 15, 2019 12:57 PM\r\nTo: Riley Myers <Riley.Myers2@bd.com>; Scott Sunseri <scott_sunseri@bd.com>; Cesar Fiestas <Cesar.Fiestas@bd.com>; Nelson Judilla <Nelson.Judilla@bd.com>\r\nSubject: RE: San Jose Survey PJC93293253\r\n\r\nThis is excellent news.  Cesar, will you come up with the timeline for procurement, WAP installs, and switch replacements?\r\n\r\nJovon English\r\nTechnical Relationship Manager - West Region\r\nIT Management\r\n*  Use ITOne<https://bdprod.service-now.com/ITOne/> for all issues and requests\r\n*  Call 877-533-2221 for immediate assistance\r\n*  Please provide me a ticket number for escalations\r\n\r\nFrom: Riley Myers <Riley.Myers2@bd.com<mailto:Riley.Myers2@bd.com>>\r\nSent: Thursday, February 14, 2019 12:50 PM\r\nTo: Scott Sunseri <scott_sunseri@bd.com<mailto:scott_sunseri@bd.com>>; Cesar Fiestas <Cesar.Fiestas@bd.com<mailto:Cesar.Fiestas@bd.com>>\r\nCc: Jovon English <Jovon.English@bd.com<mailto:Jovon.English@bd.com>>\r\nSubject: RE: San Jose Survey PJC93293253\r\n\r\nHi Scott,\r\n\r\nSwitches are typically done during refresh, there is discussion on this that hopefully will take place tomorrow with Paul Poon (BD Network Team)\r\n-         Pushing refresh of these switches up as there is a dependency of these switches and new APs that will be procured.\r\n\r\nCurrent Estimated Counts:\r\n\r\nBuilding 1                Current   Future     Estimated Square Footage\r\n-         Floor 1           19            96            211,103 Ft.2\r\n-         Floor 2           14            44            77,646 Ft.2\r\n\r\nBuilding 2\r\n-         Floor 1           13            41            84,500 Ft.2\r\n\r\nBuilding 3\r\n-         Floor 1           11            46            61,300 Ft.2\r\n\r\n\r\n\r\nThanks,\r\n[cid:image001.jpg@01D3C21F.B8E70940]\r\n\r\nRiley Myers\r\nTech 3, Infrastructure Administration\r\nInfrastructure Administration\r\n\r\nriley.myers2@bd.com<mailto:riley.myers2@bd.com>\r\n\r\n1329 W US-6, Holdrege, NE\r\nt: +1.308.995.2649\r\nc: +1.308.708.9392\r\nbd.com<https://apac01.safelinks.protection.outlook.com/?url=http%3A%2F%2Fwww.bd.com%2F&data=02%7C01%7Canish.g%40hcl.com%7C558f9e7efed94c98f0ce08d59004db0e%7C189de737c93a4f5a8b686f4ca9941912%7C0%7C0%7C636573272920852135&sdata=PP51n32wKKoU0kSvbC%2FfXVOv8YbhXqu%2BSXz6p%2FUGioU%3D&reserved=0>\r\n\r\nFrom: Scott Sunseri <scott_sunseri@bd.com<mailto:scott_sunseri@bd.com>>\r\nSent: Thursday, February 14, 2019 2:04 PM\r\nTo: Riley Myers <Riley.Myers2@bd.com<mailto:Riley.Myers2@bd.com>>; Cesar Fiestas <Cesar.Fiestas@bd.com<mailto:Cesar.Fiestas@bd.com>>\r\nCc: Jovon English <Jovon.English@bd.com<mailto:Jovon.English@bd.com>>\r\nSubject: RE: San Jose Survey PJC93293253\r\n\r\nThis includes switch / AP hardware?  Who many access points will be included to support each building?\r\n\r\nThanks,\r\n\r\nScott\r\n\r\nFrom: Riley Myers <Riley.Myers2@bd.com<mailto:Riley.Myers2@bd.com>>\r\nSent: Thursday, February 14, 2019 12:00 PM\r\nTo: Scott Sunseri <scott_sunseri@bd.com<mailto:scott_sunseri@bd.com>>; Cesar Fiestas <Cesar.Fiestas@bd.com<mailto:Cesar.Fiestas@bd.com>>\r\nSubject: RE: San Jose Survey PJC93293253\r\n\r\nHi Scott,\r\n\r\nSurvey went well, Re-Surveyed all three buildings.\r\n\r\nNoted all MDF/IDF Locations for Capacity Availability / Potential issues\r\n-         1 Major issue to be addressed potentially during this is the 100Mb Switches located in Building 1 and also noticed all switches in Building 3 are also the same model.\r\no    Cisco WS-C3750v2-48PS will need refreshed.\r\n?  These switches not only have the 100Mb Port Speed\r\n?  These switches also contain an integrated power supply not able to supply enough power required for Cisco AP we will procure.\r\n*        Power over Ethernet\r\no    The Cisco Catalyst 3750 v2 Series can provide a lower total cost of ownership (TCO) for deployments that incorporate Cisco IP Phones, Cisco Aironet(r) wireless LAN (WLAN) access points, or any IEEE 802.3af-compliant end device. the Cisco Catalyst 3750 v2 48-port PoE configurations can deliver the necessary power to support 24 ports at 15.4W, 48 ports at 7.7W, or any combination in between.\r\n\r\n\r\nCisco Aironet 3800 Series Access Points\r\n-         Input Power Requirements\r\no    802.3at PoE+, Cisco Universal Power over Ethernet (Cisco UPOE)\r\n-         Power Draw\r\no    30W at the PSE (25.5W at the PD) with the USB 2.0 Port Enabled\r\n\r\n\r\nThere is a total currently of 38 Switches in San Jose Building 1 & 3 that are Cisco WS-C3750v2-48PS\r\nB1 - FLOOR 1\r\n\r\nA1E1\r\n\r\n1\r\n\r\nA1W1\r\n\r\n3\r\n\r\nB1W1\r\n\r\n2\r\n\r\nF1W1\r\n\r\n2\r\n\r\nF1W3\r\n\r\n3\r\n\r\nC1E1\r\n\r\n1\r\n\r\nC1W1\r\n\r\n4\r\n\r\nE1W2\r\n\r\n2\r\n\r\nE1E\r\n\r\n3\r\n\r\n\r\nB1 - FLOOR 2\r\n\r\nB2W1\r\n\r\n3\r\n\r\nC2W1\r\n\r\n2\r\n\r\n\r\n\r\nB3\r\n\r\nsm\r\n\r\n4\r\n\r\nmd\r\n\r\n4\r\n\r\nlg\r\n\r\n4\r\n\r\n\r\n\r\n38\r\n\r\nSwitches\r\n\r\n\r\n\r\nWe will predicting survey more aggressively than previous for high density application following Cisco Design Guideline of ( Minimum 65 dbm Client Connectivity )\r\n\r\n\r\nWe are currently preparing BOM for Sanjit to take forward for Procuring all required hardware for this project.\r\n\r\n\r\n@Cesar Fiestas<mailto:Cesar.Fiestas@bd.com>\r\n-         Feel free to add additional information if needed.\r\n\r\n\r\nThanks,\r\n[cid:image001.jpg@01D3C21F.B8E70940]\r\n\r\nRiley Myers\r\nTech 3, Infrastructure Administration\r\nInfrastructure Administration\r\n\r\nriley.myers2@bd.com<mailto:riley.myers2@bd.com>\r\n\r\n1329 W US-6, Holdrege, NE\r\nt: +1.308.995.2649\r\nc: +1.308.708.9392\r\nbd.com<https://apac01.safelinks.protection.outlook.com/?url=http%3A%2F%2Fwww.bd.com%2F&data=02%7C01%7Canish.g%40hcl.com%7C558f9e7efed94c98f0ce08d59004db0e%7C189de737c93a4f5a8b686f4ca9941912%7C0%7C0%7C636573272920852135&sdata=PP51n32wKKoU0kSvbC%2FfXVOv8YbhXqu%2BSXz6p%2FUGioU%3D&reserved=0>\r\n\r\nFrom: Scott Sunseri <scott_sunseri@bd.com<mailto:scott_sunseri@bd.com>>\r\nSent: Thursday, February 14, 2019 12:43 PM\r\nTo: Cesar Fiestas <Cesar.Fiestas@bd.com<mailto:Cesar.Fiestas@bd.com>>\r\nCc: Riley Myers <Riley.Myers2@bd.com<mailto:Riley.Myers2@bd.com>>\r\nSubject: RE: San Jose Survey PJC93293253\r\n\r\nCesar/Riley\r\n\r\nJust getting back to work and wanted to check to see how the survey went?  Do you need any information from me?\r\n\r\nThanks,\r\n\r\nScott\r\n\r\nFrom: Cesar Fiestas <Cesar.Fiestas@bd.com<mailto:Cesar.Fiestas@bd.com>>\r\nSent: Wednesday, January 30, 2019 6:56 PM\r\nTo: Scott Sunseri <scott_sunseri@bd.com<mailto:scott_sunseri@bd.com>>\r\nCc: attach@intupro.com<mailto:attach@intupro.com>\r\nSubject: RE: San Jose Survey PJC93293253\r\n\r\nScott,\r\n\r\nExcellent, then let me coordinate with Sanjit whom is the project manager for the Wi-Fi surveys that we are conducting in BD to get confirm the dates. Thanks!\r\n\r\nBest Regards,\r\n\r\n\r\n[BD-EMail-Logo]\r\nCesar Fiestas\r\nNetwork & Voice Services Consultant\r\nRemote Office\r\nUSA    : +1   434-321-4261\r\nPERU : +51  941-757-919\r\nEmail: cesar.fiestas@bd.com<mailto:cesar.fiestas@bd.com>\r\nWhatsApp: +51941757919\r\n\r\n[ccielogo][ecselogo]\r\n\r\nbd.com\r\n\r\n\r\nFrom: Scott Sunseri\r\nSent: Wednesday, January 30, 2019 12:34 PM\r\nTo: Cesar Fiestas <Cesar.Fiestas@bd.com<mailto:Cesar.Fiestas@bd.com>>\r\nCc: attach@intupro.com<mailto:attach@intupro.com>\r\nSubject: RE: San Jose Survey PJC93293253\r\n\r\nI do not need to be there.  I can get you access when you get on-site.  I can also ask JP to assist if needed.  After you finish, I would like to schedule a quick hour to make sure we have the number of users correct for the conference rooms and heavily used areas.\r\n\r\nThanks,\r\n\r\nScott\r\n\r\nFrom: Cesar Fiestas <Cesar.Fiestas@bd.com<mailto:Cesar.Fiestas@bd.com>>\r\nSent: Wednesday, January 30, 2019 6:41 AM\r\nTo: Scott Sunseri <scott_sunseri@bd.com<mailto:scott_sunseri@bd.com>>\r\nCc: attach@intupro.com<mailto:attach@intupro.com>\r\nSubject: San Jose Survey PJC93293253\r\n\r\n\r\nScott,\r\n\r\n\r\n\r\nGood Morning Sir, just following up the  email I sent you yesterday,  wanted to get your input in regards to your availability next week.  Otherwise we can schedule something for the week of the 11th, although i wanted to get this survey for you done as soon as possible. Also scott is there an OSS person onsite?  Let me know your thoughts.\r\n\r\n*******************************************************************\r\nIMPORTANT MESSAGE FOR RECIPIENTS IN THE U.S.A.:\r\nThis message may constitute an advertisement of a BD group''s products or services or a solicitation of interest in them. If this is such a message and you would like to opt out of receiving future advertisements or solicitations from this BD group, please forward this e-mail to optoutbygroup@bd.com. [BD.v1.0]\r\n*******************************************************************\r\nThis message (which includes any attachments) is intended only for the designated recipient(s). It may contain confidential or proprietary information and may be subject to the attorney-client privilege or other confidentiality protections. If you are not a designated recipient, you may not review, use, copy or distribute this message. If you received this in error, please notify the sender by reply e-mail and delete this message. Thank you.\r\n*******************************************************************\r\nCorporate Headquarters Mailing Address: BD (Becton, Dickinson and Company) 1 Becton Drive Franklin Lakes, NJ 07417 U.S.A.\r\n', NULL, NULL, NULL, '2019-02-20 15:26:04'),
